import React from 'react'
import ReactDOM from 'react-dom'
import './index.css'

function Box(props) {
  return (
    <div className="container" style={{ backgroundColor: props.myColor, border: `2px solid ${props.borderColor}` }}></div>
  )
}

ReactDOM.render(
  <>
    <Box myColor="red" borderColor="black" />
    <Box myColor="yellow" borderColor="cyan" />
    <Box myColor="cyan" borderColor="green" />
  </>, document.getElementById("root")
)
